$(document).foundation();

//global variables:
var server = "https://server.parcell.io";

//Process form
//===============================================================
function submit_fn() {

	// Send server request
	var req = new XMLHttpRequest();
	req.onreadystatechange = function () {
		if (req.readyState === 4) {
			if (req.status === 200) {
				document.getElementById("form_success").style.display = "block";
			} else {
				document.getElementById("form_failure").style.display = "block";
			}
		}
	};

	// populate parameter_string
	var form = document.querySelectorAll('form')[0];
	var parameter_string = "";

	for (var i = 0; i < form.length; i++) {
		if (form[i].name != "") {
			parameter_string = parameter_string + form[i].name + "=" + form[i].value + "&";
		}
	}

	// lop off last &
	parameter_string = parameter_string.substring(0, parameter_string.length - 1);

	var req_str = "/betaFormEndpoint?" + parameter_string;
	req.open('POST', server + req_str, true);
	req.send();
}

